            <button className="twitter-button">Twitter</button>
          </a>
          <a href="https://www.linkedin.com/" target="_blank" rel="noopener noreferrer">
            <im></im>
          </a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
